import axios from 'axios';

const API_URL = 'http://localhost:8080/bookings';

const getAllBookings = () => axios.get(`${API_URL}/getAllBookings`);
const getBookingById = (id) => axios.get(`${API_URL}/getBooking/${id}`);
const createBooking = (data) => axios.post(`${API_URL}/createBooking`, data);
const updateBooking = (id, data) => axios.put(`${API_URL}/updateBooking/${id}`, data);
const deleteBooking = (id) => axios.delete(`${API_URL}/deleteBooking/${id}`);

export { getAllBookings, getBookingById, createBooking, updateBooking, deleteBooking };
